import React from "react";
import { Scatter } from "react-chartjs-2";

const TestGraph = (props) => {
  const entries = props.entriesByDate;

  const testData = entries.map((entry) => {
    return (entry.attendee_count, entry.time);
  });

  console.log("testData", testData);

//   let coords = pvols.map((v, i) => ({ x: v, y: prets[i] }));

  const state = {
    // labels: [-20, 20],
    datasets: [
      {
        backgroundColor: "rgba(75,192,192,1)",
        borderColor: "rgba(0,0,0,1)",
        borderWidth: 2,
        data: [
          {
            x: [2, 4, 6, 8],
            y: [1, 2, 3, 4],
          },
        ],
      },
    ],
  };

  return (
    <div>
      <Scatter
        data={state}
        options={{
          title: {
            display: true,
            text: "Attendee counts over time",
            fontSize: 20,
          },
          legend: {
            display: false,
          },
          scales: {
            // xAxes: [
            //   {
            //     labels: [-30, 30],
            //     type: "linear",
            //     ticks: {
            //       max: -30,
            //       min: 40,
            //       stepSize: 10,
            //     },
            //   },
            // ],
            yAxes: [
              {
                ticks: {
                  beginAtZero: true,
                },
              },
            ],
          },
        }}
      />
    </div>
  );
};

export default TestGraph;
